import React from 'react';
import githubIcon from '../assets/github.png';
import linkedinIcon from '../assets/linkedin.png';

const Header = () => {
    return (
        <header style={styles.header}>
            {/* Left Side: Website Name */}
            <div style={styles.left}>
                <a href="/" style={styles.link}>
                    chasecvitale
                </a>
            </div>

            {/* Right Side: Links */}
            <div style={styles.right}>
                <a href="/resume" style={styles.link}>
                    Resume
                </a>
                <a href="https://www.linkedin.com/in/chasecvitale/" target="_blank" rel="noopener noreferrer" style={styles.link}>
                    <img src={linkedinIcon} alt="LinkedIn" style={{ width: '10x' }} />
                </a>
                <a href="https://github.com/chasecvitale" target="_blank" rel="noopener noreferrer" style={styles.link}>
                    <img src={githubIcon} alt="GitHub" style={{ width: '20px' }} />
                </a>
            </div>
        </header>
    );
};

const styles = {
    header: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '40px',
        backgroundColor: '#e0e0dc',
        color: 'white',
    },
    left: {
        fontSize: '1.5rem',
        fontWeight: 'bold',
    },
    right: {
        display: 'flex',
        gap: '1.5rem',
    },
    link: {
        color: 'black',
        textDecoration: 'none',
        fontSize: '1rem',
        alignItems: 'center',
    },
};

export default Header;
